const PriorityQueue = require('./util/PriorityQueue');

/**
 * @param {string} str
 * @param {number} k
 * @return {string}
 */
var rearrangeString = function(str, k) {
    if (k === 0) {
        return str;
    }

    let length = str.length;
    let result = '';
    const dict = new Map();
    const pq = new PriorityQueue((a) => a[0]);

    for (const ch of str) {
        if (dict.has(ch)) {
            dict.set(ch, dict.get(ch) + 1);
        } else {
            dict.set(ch, 1);
        }
    }

    for (const [key, val] of dict.entries()) {
        pq.push([val, key]);
    }

    while (!pq.isEmpty()) {
        const cache = [];
        let count = Math.min(k, length);
        for (let i = 0; i < count; i += 1) {
            if (pq.isEmpty()) {
                return '';
            }
            const tmp = pq.pop();
            result += tmp[1];
            tmp[0] -= 1;
            if (tmp[0] > 0) {
                cache.push(tmp);
            }
            length -= 1;
        }
        for (const p of cache) {
            pq.push(p);
        }
    }

    return result;
};

console.log(rearrangeString("abb", 2)); // bab
console.log(rearrangeString("aabbcc", 3)); // cbacba
console.log(rearrangeString("", 26));
